/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `buying` BEFORE INSERT ON `cart` FOR EACH ROW BEGIN
 DECLARE msg TEXT DEFAULT ' ';
IF (NEW.quantity > (select quantity from waybill where waybill.shoes_idshoes=new.shoes_idshoes)) THEN
BEGIN
SET msg = CONCAT('Can\`t checkout! The quantity of the
product in the order is more than it exists!');
SIGNAL SQLSTATE '45000' SET MYSQL_ERRNO=30001,
MESSAGE_TEXT=msg;
END;
 ELSEIF(NEW.quantity > 0 AND NEW.quantity <= (select quantity from waybill
 where waybill.shoes_idshoes=new.shoes_idshoes
)) THEN
BEGIN
UPDATE waybill SET quantity = quantity - NEW.quantity
where waybill.shoes_idshoes=new.shoes_idshoes;
 END;
ELSE
BEGIN
SET msg = CONCAT('Can\`t checkout! The quantity of the
product can\`t be negative or zero!');
SIGNAL SQLSTATE '45000' SET MYSQL_ERRNO=30001,
MESSAGE_TEXT=msg;
 END;
 END IF;
END */;;
